import React from "react";
import ReactDOM from "react-dom";
// import App from "./App";


function Card(props){
return(
<>
<div className="cards">
    <div className="card">
     <img src={props.imgsrc} alt="myPic" className="card_image"/>

    <div className="card_info">
      <span className="card_category">{props.title}</span>
       <h3 className="card_title>">{props.sname}</h3>
         <a href={props.link} target="_blank">
          <button>Watch Now</button>
         </a>
     </div>
    </div>
</div>
    </>
    )
}


ReactDOM.render(
    <>
   <Card imgsrc="https://talenthouse-res.cloudinary.com/image/upload/c_limit,f_auto,fl_progressive,h_1280,w_1280/v1542781501/user-936977/submissions/xlo46stvzbjboqp4lwsi.jpg"
         title="A NetFlix Original Series"
         sname="Mirzapur"
         link="https://www.netflix.com/search/Mirzapur+%282018%29"
    />
   <Card />
   <Card />
   </>,
    document.getElementById("root")
);
